    ["200200110"]={id=200200110,leaderId=2002001,talkType=3,aniName="024_jiaotan04",aniIntegerName="jiaotan",aniInteger=4,aniEndIntegerName="zhanli",aniEndInteger=1,showTime=9.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2002112,time={[1]=2.849,[2]=5.272,[3]=2.209,[4]=2.16,[5]=4.366},words1="将源能像这样汇聚，",words2="然后“嘭”的一下发射出去就可以了……",words3="这样做不对么？",words4="就算你说不对也没有用，",words5="这可是很久以前有个整天笑嘻嘻的家伙教我的啦。",words6="",dialog="将源能像这样汇聚，然后“嘭”的一下发射出去就可以了……这样做不对么？就算你说不对也没有用，这可是很久以前有个整天笑嘻嘻的家伙教我的啦。",des="交谈3-源能相关"},
    ["200200111"]={id=200200111,leaderId=2002001,talkType=3,aniName="025_jiaotan05",aniIntegerName="jiaotan",aniInteger=5,aniEndIntegerName="zhanli",aniEndInteger=1,showTime=10.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002113,time={[1]=3.1,[2]=3.225,[3]=2.794,[4]=1.596,[5]=2.035,[6]=2.85},words1="我一直都在帮卡娜莉亚收集她需要的材料，",words2="作为报酬，她会给我提供我需要的道具，",words3="这可不是什么秘密交易。",words4="有了这些小道具，",words5="就算是源能不如其他人的我，",words6="也还是能够收拾掉这些异生体的。",dialog="我一直都在帮卡娜莉亚收集她需要的材料，作为报酬，她会给我提供我需要的道具，这可不是什么秘密交易。有了这些小道具，就算是源能不如其他人的我也还是能够收拾掉这些异生体的。",des="交谈4-达成友好后追加一句"},
    ["200200112"]={id=200200112,leaderId=2002001,talkType=3,aniName="026_jiaotan06",aniIntegerName="jiaotan",aniInteger=6,aniEndIntegerName="zhanli",aniEndInteger=1,showTime=18.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2002114,time={[1]=6.761,[2]=3.79,[3]=3.889,[4]=2.157},words1="这枚硬币？是一位对我很重要的人给我的。",words2="每个人总有一两件特别的东西吧，",words3="或许有一天我会把这枚硬币的故事讲给你听，",words4="但不是现在。",words5="当然想啊，可被抛弃的人怎么会有家呢。",words6="",dialog="这枚硬币？是一位对我很重要的人给我的。每个人总有一两件特别的东西吧，或许有一天我会把这枚硬币的故事讲给你听，但不是现在。",des="交谈5-达成熟识后追加一句"},
    ["200200113"]={id=200200113,leaderId=2002001,talkType=3,aniName="027_jiaotan07",aniIntegerName="jiaotan",aniInteger=7,aniEndIntegerName="zhanli",aniEndInteger=1,showTime=22.5,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002115,time={[1]=2.754,[2]=6.059,[3]=3.487,[4]=3.117},words1="导师，帮我递一下那边的钳子。",words2="好嘞，今天的保养工作搞定。",words3="嗯？这些可都是保命的东西，",words4="不好好保养可是会出大问题的！",words5="",words6="",dialog="好嘞，今天的保养工作搞定。嗯？这些可都是保命的东西，不好好保养可是会出大问题的！",des="交谈6-达成亲密后追加一句"},
