    ["200300106"]={id=200300106,leaderId=2003001,talkType=6,aniName="ChangshijianDengluwenhou_Close",aniIntegerName="denglu",aniInteger=6,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=5},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2003122,time=xlsNilTable,words1="哼哼哼~哼哼哼哼哼~咦？好像在哪里听过这个旋律，唔，在哪里呢？",words2="",words3="",words4="",words5="",words6="",dialog="好久不见！夏洛不想和导师分开，只能在记忆中……没事的，你能回来我很开心~"},
    ["200300107"]={id=200300107,leaderId=2003001,talkType=6,aniName="Tedingshijianwenhou",aniIntegerName="denglu",aniInteger=7,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=5},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2003108,time=xlsNilTable,words1="这个时间了导师你竟然还没休息啊！夏洛吗？夏洛一直都超——有精神的！",words2="",words3="",words4="",words5="",words6="",dialog="这个时间了导师你竟然还没休息啊！夏洛吗？夏洛一直都超——有精神的！"},
