    ["200300109"]={id=200300109,leaderId=2003001,talkType=3,aniName="Jiaotan02",aniIntegerName="jiaotan",aniInteger=2,aniEndIntegerName="",aniEndInteger=0,showTime=2.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2003111,time=xlsNilTable,words1="你问我为什么会留在尼伯龙根号上？唔，在这里可以去各种不同的地方，还可以遇见很多有趣的人，最重要的是，这种生活可是夏洛一直很向往的！",words2="",words3="",words4="",words5="",words6="",dialog="在天空中待久了偶尔也会怀念地上的生活呀……"},
    ["200300110"]={id=200300110,leaderId=2003001,talkType=3,aniName="Jiaotan03",aniIntegerName="jiaotan",aniInteger=3,aniEndIntegerName="",aniEndInteger=0,showTime=9.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2003112,time=xlsNilTable,words1="以前在家里的时候，偶尔也会像这样去阳台上休憩一下，但阳台前的只是一尘不变的景色，如今能够见到这样不断变化的景象是那时的我最初的梦想，谢谢导师实现我最初的梦想！",words2="",words3="",words4="",words5="",words6="",dialog="将源能释放出一点后覆盖在自己的身上就可以提升感知力啦，虽然听起来很简单，其实操作起来还蛮困难的，需要大量的练习还有一点天赋啦~"},
    ["200300111"]={id=200300111,leaderId=2003001,talkType=3,aniName="Jiaotan04",aniIntegerName="jiaotan",aniInteger=4,aniEndIntegerName="",aniEndInteger=0,showTime=10.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2003113,time=xlsNilTable,words1="导师，前不久奈纳说去旅行要准备好多好多钱的，夏洛并没有准备就跑了出来，这可怎么办呀，不知道哪里可以抵押式杖呢……哎？不可以么？唔，那就只能想想别的办法了呀……",words2="",words3="",words4="",words5="",words6="",dialog="你问我为什么会留在尼伯龙根号上？唔，在这里可以去各种不同的地方，还可以遇见很多有趣的人，最重要的是，这种生活可是夏洛一直很向往的！"},
    ["200300112"]={id=200300112,leaderId=2003001,talkType=3,aniName="Jiaotan05",aniIntegerName="jiaotan",aniInteger=5,aniEndIntegerName="",aniEndInteger=0,showTime=18.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2003114,time=xlsNilTable,words1="时常出现在夏洛脑海之中的声音，与其说那是歌声，倒不如说是恸哭要更贴切一些，虽然夏洛很想立刻把这台出现故障的播放器关掉，但果然还是应该先搞清楚发出悲鸣的究竟是什么，探索未知才是旅行的真谛嘛！",words2="",words3="",words4="",words5="",words6="",dialog="以前在家里的时候，偶尔也会像这样去阳台上休憩一下，但阳台前的只是一尘不变的景色，如今能够见到这样不断变化的景象是那时的我最初的梦想，谢谢导师实现我最初的梦想！"},
    ["200300113"]={id=200300113,leaderId=2003001,talkType=3,aniName="Jiaotan06",aniIntegerName="jiaotan",aniInteger=6,aniEndIntegerName="",aniEndInteger=0,showTime=22.5,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2003115,time=xlsNilTable,words1="无论是什么样的旅途，都会有终点，一段旅程的终点或许是另一段旅程的起点。导师，等我们到达这一程的终点后，要不要和夏洛一起踏上新的旅途呢？",words2="",words3="",words4="",words5="",words6="",dialog="导师，前不久奈纳说去旅行要准备好多好多钱的，夏洛并没有准备就跑了出来，这可怎么办呀，不知道哪里可以抵押式杖呢……哎？不可以么？唔，那就只能想想别的办法了呀……"},
    ["200300114"]={id=200300114,leaderId=2003001,talkType=3,aniName="Jiaotan07",aniIntegerName="jiaotan",aniInteger=7,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.3,voiceTime=0.0,characterVoiceId=2003116,time=xlsNilTable,words1="虽然夏洛很欣赏导师沉迷工作的样子……但是持续劳动会让效率降低的哦？",words2="",words3="",words4="",words5="",words6="",dialog="时常出现在夏洛脑海之中的声音，与其说那是歌声，倒不如说是恸哭要更贴切一些，虽然夏洛很想立刻把这台出现故障的播放器关掉，但果然还是应该先搞清楚发出悲鸣的究竟是什么，探索未知才是旅行的真谛嘛！"},
    ["200300115"]={id=200300115,leaderId=2003001,talkType=3,aniName="Jiaotan08",aniIntegerName="jiaotan",aniInteger=8,aniEndIntegerName="",aniEndInteger=0,showTime=15.6,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2003117,time=xlsNilTable,words1="头，头好晕。",words2="",words3="",words4="",words5="",words6="",dialog="无论是什么样的旅途，都会有终点，一段旅程的终点或许是另一段旅程的起点。导师，等我们到达这一程的终点后，要不要和夏洛一起踏上新的旅途呢？"},
    ["200300116"]={id=200300116,leaderId=2003001,talkType=7,aniName="changshijianyouwan",aniIntegerName="changshijianyouwan",aniInteger=1,aniEndIntegerName="",aniEndInteger=0,showTime=10.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2003120,time=xlsNilTable,words1="咿呀！导师你在做什么？！",words2="",words3="",words4="",words5="",words6="",dialog="虽然夏洛很欣赏导师沉迷工作的样子……但是持续劳动会让效率降低的哦？"},
