    ["200300121"]={id=200300121,leaderId=2003001,talkType=2,aniName="Xiuxian01",aniIntegerName="xiuxian",aniInteger=1,aniEndIntegerName="",aniEndInteger=0,showTime=7.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.4,voiceTime=0.0,characterVoiceId=2003105,time=xlsNilTable,words1="导师！突然听到导师熟悉的声音，夏洛还有点……不能哭啦！",words2="",words3="",words4="",words5="",words6="",dialog="这里的景色导师是不是也看入迷了呀？"},
    ["200300122"]={id=200300122,leaderId=2003001,talkType=2,aniName="Xiuxian02",aniIntegerName="xiuxian",aniInteger=2,aniEndIntegerName="",aniEndInteger=0,showTime=5.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.3,voiceTime=0.0,characterVoiceId=2003106,time=xlsNilTable,words1="好久不见！夏洛不想和导师分开，只能在记忆中……没事的，你能回来我很开心~",words2="",words3="",words4="",words5="",words6="",dialog="哼哼哼~哼哼哼哼哼~咦？好像在哪里听过这个旋律，唔，在哪里呢？"},
    ["200300123"]={id=200300123,leaderId=2003001,talkType=2,aniName="IdleSwitch",aniIntegerName="xiuxian",aniInteger=3,aniEndIntegerName="",aniEndInteger=0,showTime=5.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.4,voiceTime=0.0,characterVoiceId=2003107,time=xlsNilTable,words1="这个时间了导师你竟然还没休息啊！夏洛吗？夏洛一直都超——有精神的！",words2="",words3="",words4="",words5="",words6="",dialog="现在小声地演奏一下乐器也没关系的吧。"},
