    ["200400106"]={id=200400106,leaderId=2004001,talkType=6,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=5},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2002122,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="你离开的这期间……很值得庆幸，瓦哈纳一切如常。唯一的不同是大家都在惦念着你。"},
    ["200400107"]={id=200400107,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=8.2,triggerLevel=xlsNilTable,triggerTime={[1]=14,[2]=16},playRules=1,priority=0.5,voiceTime=0.0,characterVoiceId=2002108,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="导师，你来的正好，晚间的训练刚刚开始，如果没有要紧的事就去参加训练吧，法尼娅她们也在那边，保持绝佳的身体素质也是十分重要的一环。"},
    ["200400108"]={id=200400108,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=4.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.3,voiceTime=0.0,characterVoiceId=2002110,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="独来独往的生活似乎无法继续了……我会尽快适应的。"},
    ["200400109"]={id=200400109,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=2.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002111,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我？没有什么可以谈论的东西。"},
    ["200400110"]={id=200400110,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2002112,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="战斗方式？这可没有什么复杂的理由。不能做到快速汇聚源能击杀敌人，那就只能被敌人击杀，就是这么简单。"},
    ["200400111"]={id=200400111,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=10.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002113,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我很清楚，我们现在是互利互惠的关系。在完成我的使命前，我都会遵从你的指示。"},
    ["200400112"]={id=200400112,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=18.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2002114,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我们身后那个庞然大物，藏有太多的秘密了，我也只是窥见了它的冰山一角。我需要你的力量去找出它更多的秘密，斯露德不应当就这样受它们的摆布，至少，给我的过去有个交代。"},
    ["200400113"]={id=200400113,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=22.5,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002115,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我这里还有一些上好的酒，前不久拜托夏洛帮忙搞到的，你要尝一尝么？啊，抱歉，我忘记你喝不了酒了，真是遗憾。"},
    ["200400114"]={id=200400114,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.3,voiceTime=0.0,characterVoiceId=2002116,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="如果有一天你了解到我的过去，也请不要流露出同情的表情。"},
    ["200400115"]={id=200400115,leaderId=2004001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=15.6,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2002117,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="稍微有些习惯现在的生活了啊，不得不说你做的很好啊，搭档。嗯？为什么是搭档？不，不要在意，只是将合作者换了一种说法而已，嗯。"},
    ["200400116"]={id=200400116,leaderId=2004001,talkType=7,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=10.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2002120,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="精神是意志力的基础，还请劳逸结合，导师。"},
