    ["200400126"]={id=200400126,leaderId=2004001,talkType=12,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=5.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2002109,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="导师你找我么？我的任务还没有完成，如果没有要紧的事情，我就先……不，我还是陪陪你好了。"},
    ["200400127"]={id=200400127,leaderId=2004001,talkType=5,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=22.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="生日啊……从前对我来说是无关紧要的事，不过能够听到你的祝福，这让我倍感荣幸。"},
    ["200400128"]={id=200400128,leaderId=2004001,talkType=4,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=0.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.0,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我本以为没什么事能让我开心了，但今天我很高兴，导师，生日快乐。"},
    ["200400129"]={id=200400129,leaderId=2004001,talkType=0,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=0.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.9},
