    ["200500101"]={id=200500101,leaderId=2005001,talkType=1,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=8.0,triggerLevel={[1]=1,[2]=4},triggerTime={[1]=4,[2]=18},playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001101,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="导师，要喝杯茶么？"},
    ["200500102"]={id=200500102,leaderId=2005001,talkType=1,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=8},triggerTime={[1]=4,[2]=18},playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001102,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="（笑）刚好我正在想你什么时候会来，你就出现了。"},
    ["200500103"]={id=200500103,leaderId=2005001,talkType=1,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=4.5,triggerLevel={[1]=1,[2]=4},triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001103,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="晚上好，导师。"},
    ["200500104"]={id=200500104,leaderId=2005001,talkType=1,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.5,triggerLevel={[1]=5,[2]=8},triggerTime={[1]=18,[2]=24,[3]=0,[4]=4},playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001104,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="又见面了，你也很喜欢这里吗？"},
    ["200500105"]={id=200500105,leaderId=2005001,talkType=6,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=8.0,triggerLevel={[1]=4,[2]=4},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001121,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="好久不见，让我猜猜，你是有了新的研究成果么？如果方便的话，可以讲给我听吗？"},
    ["200500106"]={id=200500106,leaderId=2005001,talkType=6,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=5},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001122,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="有一段时间没有见到你了，还以为，我被讨厌了……"},
    ["200500107"]={id=200500107,leaderId=2005001,talkType=6,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=5},triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001108,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="早上好导师，你也是来观察源能海的变化吗？哎？不是么。"},
    ["200500108"]={id=200500108,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=4.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.3,voiceTime=0.0,characterVoiceId=2001110,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我知道很多，但也有很多不知道的，学无止境。"},
    ["200500109"]={id=200500109,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=2.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2001111,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="呀！刚刚，是不是有什么东西一闪而过？！"},
    ["200500110"]={id=200500110,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2001112,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="利用古代的符文来凝聚力量，是一种十分便利的战斗方式，在使用符文这方面和阐释工坊的人比起来，我只是个半吊子而已。导师想要学习那些符文或许可以找找她们？不过先提醒你哦，那些符文，很难记忆的，你确定要学吗？"},
    ["200500111"]={id=200500111,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=10.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2001113,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="维拉小姐总是对我抱有强烈的敌意，是因为……（很认真的）我不小心把她的布丁吃掉了吗？"},
    ["200500112"]={id=200500112,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=18.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2001114,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="一个人游历四方，一个人整理书籍，一个人聆听旷野中的音乐，一个人做了各种各样的事。至少在这里，我不再是孤单一人。"},
    ["200500113"]={id=200500113,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=22.5,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2001115,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="你想从我这里知道什么呢？关于星辰和大地，还是REVO的秘密呢？又或者，只是关于我？"},
    ["200500114"]={id=200500114,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=9.0,triggerLevel={[1]=5,[2]=8},triggerTime=xlsNilTable,playRules=1,priority=0.3,voiceTime=0.0,characterVoiceId=2001116,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="餐厅的下午茶意外的很有品味，（意识到前面的话有点没礼貌）啊，不，我的意思是，竟然能够弄到这些东西，卡纳莉娅小姐是一位了不起的商人呢。"},
    ["200500115"]={id=200500115,leaderId=2005001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=15.6,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=1,priority=0.1,voiceTime=0.0,characterVoiceId=2001117,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="我所知晓的信息，已经全部告诉你了哦。我只是一位研究者，对于我来说，并没有需要隐藏的秘密，或许，我也只是REVO手中的一枚棋子。"},
    ["200500116"]={id=200500116,leaderId=2005001,talkType=7,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=10.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001120,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="稍微休息一下吧，张弛有度才是最健康的学习方法。"},
    ["200500117"]={id=200500117,leaderId=2005001,talkType=8,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=3.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.2,voiceTime=0.0,characterVoiceId=2001123,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="有些天旋地转的，是我，看书看太久的后遗症吗？"},
    ["200500118"]={id=200500118,leaderId=2005001,talkType=8,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=0.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.0,voiceTime=0.0,characterVoiceId=2001124,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="呀！突然站不稳，有些失礼了。"},
    ["200500119"]={id=200500119,leaderId=2005001,talkType=9,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=3.0,triggerLevel={[1]=1,[2]=8},triggerTime=xlsNilTable,playRules=0,priority=0.6,voiceTime=0.0,characterVoiceId=2001125,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="嗯？你说吧，我在听哦。"},
    ["200500120"]={id=200500120,leaderId=2005001,talkType=9,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=3.0,triggerLevel={[1]=1,[2]=8},triggerTime=xlsNilTable,playRules=0,priority=0.4,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="唔？是有什么新的发现要告诉我吗？"},
    ["200500121"]={id=200500121,leaderId=2005001,talkType=2,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=7.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.4,voiceTime=0.0,characterVoiceId=2001105,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="（正在看书的时候一抬头发现导师在发呆）怎么？有什么事么？（合书）"},
    ["200500122"]={id=200500122,leaderId=2005001,talkType=2,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=5.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.3,voiceTime=0.0,characterVoiceId=2001106,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="书中记载，大地之上四季轮替景色交错，然而同样是山脉，极夜山脉常年积雪，索尔拉斯山脉却常年炽热无比，难道……唔。（沉思）"},
    ["200500123"]={id=200500123,leaderId=2005001,talkType=2,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=5.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.4,voiceTime=0.0,characterVoiceId=2001107,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="嗯？有什么在变化……得好好记录下来才行。"},
    ["200500124"]={id=200500124,leaderId=2005001,talkType=8,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=3.2,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.5,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="发生了什么事情，源能海出现变故了吗？"},
    ["200500125"]={id=200500125,leaderId=2005001,talkType=8,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=3.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.3,voiceTime=0.0,characterVoiceId=2001126,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="嗯？叫我稍微休息一下吗？你说的是呢，谢谢你的关心。"},
    ["200500126"]={id=200500126,leaderId=2005001,talkType=12,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=5.5,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=2001109,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="啊（看到导师有些小惊讶的轻呼），导师，你是出来散心的吗？这里的景色很不错，你不介意我在你的身边待一会儿吧？船舱里有些闷热，偶尔也会想出来透透气。"},
    ["200500127"]={id=200500127,leaderId=2005001,talkType=5,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=22.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=1.0,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="导师，谢谢你的礼物，自从离开家以来，这是我收到的第一份礼物，就像是……一瞬间回到了小时候一样。"},
    ["200500128"]={id=200500128,leaderId=2005001,talkType=4,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=0.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.0,voiceTime=0.0,characterVoiceId=0,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="导师生日快乐，不知道该送给你怎样的礼物，思来想去，大概这是最合适的礼物了吧，希望你能够从中获得你想要知晓的内容。"},
    ["200500129"]={id=200500129,leaderId=2005001,talkType=0,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=0.0,triggerLevel=xlsNilTable,triggerTime=xlsNilTable,playRules=0,priority=0.9},
