    ["200600109"]={id=200600109,leaderId=2006001,talkType=3,aniName="",aniIntegerName="",aniInteger=0,aniEndIntegerName="",aniEndInteger=0,showTime=2.0,triggerLevel={[1]=1,[2]=5},triggerTime=xlsNilTable,playRules=1,priority=0.2,voiceTime=0.0,characterVoiceId=2002111,time=xlsNilTable,words1="",words2="",words3="",words4="",words5="",words6="",dialog="虽然我负责耶拉的护卫任务，但其实单论战斗力，耶拉比我更强，只不过她战斗时有点太过鲁莽了。"},
